import React from "react";
import ControlledSwitches from "./ControlledSwitches";
import ResponsiveAppBar from "./Header";
import MiniDrawer from "./Drawer";
import BasicGrid from "./Box";

function App() {
  return (
    <div className="app"> 
      <MiniDrawer/>
      <BasicGrid/>
      <ControlledSwitches/>
    </div>
  );
}

export default App;
